import React from 'react';
import '../App.css';

class Banner extends React.Component {
	Socials = () => {
		return (
			<ul>
				<li>
					<a href=''>Github</a>
				</li>
				<li>
					<a href=''>Youtube</a>
				</li>
				<li>
					<a href=''>Patreon</a>
				</li>
				<li>
					<a href=''>Twitter</a>
				</li>
			</ul>
		);
	};
	BannerTitle = () => {
		return (
			<div>
				<h1>Bret Fisher</h1>
				<p>
					Bestselling Courses and Training on DevOps and Containers.
					Docker Captain.
				</p>
			</div>
		);
	};
	render() {
		return (
			<div className='banner'>
				<this.BannerTitle />
				<this.Socials />
			</div>
		);
	}
}

export default Banner;
